import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    const name = 'Larry';
    const a = 5;
    const b = 7;

    return (
      <div className="App">
        <h1>The App Component</h1>
        <h4>Hallo {name}</h4>
        <h4>Hallo {name.toUpperCase()}</h4>
        <h4>1 + 1 = {1 + 1}</h4>
        <h4>a + b = {a + b}</h4>
      </div>
    );
  }
}

export default App;
